import React, { Component } from 'react'
import '../node_modules/materialize-css/dist/css/materialize.css';
import AnchorLink from 'react-anchor-link-smooth-scroll'



const SmoothScroll=()=>{
    return (
        <section>
        <div className="navbar-fixed">
        <div className="orange">
        <div className="container">
        <div className="nav-wrapper">
        <AnchorLink href="" className="brand-logo">FoodMania</AnchorLink>
        <AnchorLink href=""  data-target="mobile-demo" className="navbar-trigger"><i className="material-icons">menu</i></AnchorLink>
        <ul className="u">
               <li><AnchorLink href="/home">Home</AnchorLink></li>
               <li><AnchorLink href="/menu">Menu</AnchorLink></li>
               <li><AnchorLink href="/contact">Contact</AnchorLink></li>
               
        </ul>

        </div>
        </div>
        </div>
        </div>
        </section>
    )
}

export default class navbar extends Component {
    render() {
        return (
            <div>
                <SmoothScroll />
            </div>
        )
    }
}
